import Styled from "styled-components";

export const H5 = Styled.div`
 font-size: 20px;
 font-weight: 500;
 text-decoration: underline;
 color: #006778;
 padding: 5px 15px;
`;

export const Divi = Styled.div`
  border-bottom: 1px solid grey;
`;
